      <div className="bookpage-main">
        <div className="bookpage-nav">
          <MainNav showSearch = {true}/>
        </div>

        <div className = "bookpage-content">
          <BookForm/>
        </div>


        <footer>
          <Footer/>
        </footer>
      </div>
    );
  }
}
